import logo from "./logo.svg";
import "./App.css";
import React from "react";
import Areas from "./Area_city/Area";
import Cities from "./Area_city/Citis";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selected_area_id: 0,
      selected_city_id: 0,
    };
  }

  render() {
    return (
      <div>
        <Areas
          onSlected={function (id) {
            console.log({ id });
            this.setState({ selected_area_id: Number(id) });
          }.bind(this)}
        ></Areas>
        <Cities
          area_id={this.state.id}
          onSlected={function (id) {
            console.log({ id });
            this.setState({ selected_city_id: Number(id) });
          }}
        ></Cities>
      </div>
    );
  }
}

export default App;
